#include <gtest/gtest.h>#include <Unet/UdpSocket.hpp>TEST ( UdpSocket , DoesNotThrowWhileDefaultConstruction ){    ASSERT_NO_THROW(Unet::UdpSocket());}TEST ( UdpSocket , DoesNotThrowWhileOpening ){    Unet::UdpSocket udpSocket;    ASSERT_NO_THROW(udpSocket.open());}int main ( int argc , char** argv ){    ::testing::InitGoogleTest(&argc, argv);    return RUN_ALL_TESTS();}